import "./style.css";

const Tasks = (props) => (
    <ul className="list">
        {props.tasks.map(task => (
            <li type ="none">

            className={`"list__items
            ${task.done && props.hideDoneTasks ? " list__item--hidden" : ""}"`}
                {task.content}
            </li>
        ))}
    </ul>
);

export default Tasks;
